#include <iostream>
#include <vector>

using namespace std;

int uniquePathsWithObstacles(vector<vector<int>> &obstacleGrid)
{
    int m = obstacleGrid.size();
    int n = obstacleGrid[0].size();

    vector<int> t(n, 0);
    t[n - 1] = 1;
    for (int i = m - 1; i >= 0; i--)
        for (int j = n - 1; j >= 0; j--)
        {
            if (obstacleGrid[i][j])
                t[j] = 0;
            else if (j + 1 < n)
                t[j] += t[j + 1];
        }
    return t[0];
}

